 the responsibilities of our\r\nchildren as learners.</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoNormal"><span style="font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Cambria&quot;,serif">Since VBCA believes in direct, frank and honest disposition of\r\nall matters concerning schools policies and activities, all our comments and\r\ninquiries will be properly addressed to or communicated personally with my\r\nchilds Teacher, the Principal, Director or Administrator on a fair and biblical\r\nconduct based on Christian Ethics. We further pledge to be loyal to the\r\ninstitution where God has placed our Child.<o:p></o:p></span></p>', 0, 0, 0, 0, 'http://vbca-essentiel.ckgroup.ph', 1, 'vbca', 0, NULL, 0, 0, 0, NULL);
